import React from 'react';
import ReactDOM from 'react-dom';
import Sampleform from './Heading';

var time = new Date(2020,2,2,10).getHours();
var Greetings = '';
if(time>=1 && time<12){
  Greetings = `Good Morning ${time}`;
}
else if(time>=12 && time<19){
  alert(`Good AfterNoon ${time}`)
}
else{
  alert(`Good Night ${time}`);
}


ReactDOM.render(
  <>
    {Greetings}
    <Sampleform />
  </>,
  document.getElementById("root")
);
